(52, 40, 0, 'Hard Disk', '', '1.00', '300.00', '6.00', '10.00', '286.20', '18.00', '31.80', 'A well-organized paragraph supports or \r\n1) develops a single controlling idea, which is expressed in a sentence called the topic sentence. \r\n2) A topic sentence has several important functions: it substantiates or supports an essay’s thesis statement;\r\n3) it unifies the content of a paragraph and directs the order of the sentences; and it advises the reader of the subject to be discussed and how the paragraph will discuss it. Readers generally look to the first few sentences in a paragraph to determine the subject and perspective of the paragraph. That’s why it’s often best to put the topic sentence at the very beginning of the paragraph. In some cases, however, it’s more effective to place another sentence before the topic sentence—for example, a sentence linking the current paragraph to the previous one, or one providing background information.\r\n\r\nAlthough most paragraphs should have a topic sentence, there are a few situations when a paragraph might not need a topic sentence. For example, you might be able to omit a topic sentence in a paragraph that narrates a series of events, if a paragraph continues developing an idea that you introduced (with a topic sentence) in the previous paragraph, or if all the sentences and details in a paragraph clearly refer—perhaps indirectly—to a main point. The vast majority of your paragraphs, however, should have a topic sentence.', 0, '', ''),
(53, 40, 0, 'USB', '', '1.00', '400.00', '6.00', '10.00', '381.60', '24.00', '42.40', '1) Most paragraphs in an essay have a three-part structure—introduction, body, and conclusion. \r\n2) You can see this structure in paragraphs whether they are narrating, describing, comparing, contrasting, or analyzing information. \r\n3) Each part of the paragraph plays an important role in communicating your meaning to your reader.\r\n\r\nIntroduction: the first section of a paragraph; should include the topic sentence and any other sentences at the beginning of the paragraph that give background information or provide a transition.\r\n\r\nBody: follows the introduction; discusses the controlling idea, using facts, arguments, analysis, examples, and other information.\r\n\r\nConclusion: the final section; summarizes the connections between the information', 0, '', ''),
(54, 42, 0, 'pos system ', '', '1.00', '200.00', '6.00', '0.00', '212.00', '12.00', '0.00', 'pos hardware ', 0, '', '');

